INSERT INTO `oc_information_description` VALUES
(3,1,'Privacy Policy','&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px;&quot;&gt;This Privacy Policy covers the information Woodpeel Furniture\r\nand Livingstyles Pvt Ltd (&quot;We&quot;) collects from the user(s)\r\n(&quot;User(s)&quot; and/or &quot;You&quot;) of www.woodpeel.com\r\n(&quot;Website&quot;) This Privacy Policy should be read in conjunction and\r\ntogether with the User Agreement of the Website available on&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px;&quot;&gt;https://www.w&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px;&quot;&gt;oodpeel&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px;&quot;&gt;.com/privacy_policy.html&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;. Personal Information of a User(s) is collected if the User(s)\r\nregisters with the Website, accesses the Website or take any action on the\r\nWebsite. Here are our privacy principles:&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Providing information to us is your choice.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;You can choose to have the Personal Information provided by You\r\ndeleted.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;You always have the ability to opt-out of receiving\r\ncommunications from us.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;font-bold&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Device permissions &amp;amp; Information Collection and Use section&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;The Personal Information Which You may provide to us and/or\r\nwhich we may collect is or could be the following:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;margin-left: 36pt;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;1.&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Your registration\r\ndetails which may include the email address and password provided by You. You\r\nmay note that We adopt reasonable security measures to protect Your password\r\nfrom being exposed or disclosed to anyone including the Platform.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;margin-left: 36pt;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;2.&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Your shipping,\r\nbilling, tax registration, and other information pertaining to Your sale or\r\npurchase transaction on the Website.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;margin-left: 36pt;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;3.&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Your transaction\r\ndetails with the other users of the Website. Your usage behavior of the\r\nWebsite.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;margin-left: 36pt;&quot;&gt;&lt;!--[if !supportLists]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;4.&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; line-height: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Details of the\r\ncomputer system or computer network which You use to visit the Website and\r\nundertake any activity on the Website.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;font-bold&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Changes in Privacy Policy&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;From time to time We may update this Privacy Policy. Your\r\ncontinued subscription to our Services constitutes an acceptance of the\r\nthen-current Privacy Policy and Terms of Use so We encourage You to visit this\r\npage periodically to review any changes&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;font color=&quot;#121212&quot; face=&quot;Arial, sans-serif&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;font color=&quot;#121212&quot; face=&quot;Arial, sans-serif&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-md&quot; style=&quot;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;font color=&quot;#121212&quot; face=&quot;Arial, sans-serif&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n','Privacy Policy','',''),
(7,1,'Returns &amp; Cancellations','&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;1) What if the customer receives damaged product?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;Woodpeel takes full responsibility of damaged product &amp;amp; we’ll arrange a carpenter in case of minor damage (like chip-off/scratch/peel-off).&lt;br&gt;If it is not possible to correct the damaged area good as new, we’ll replace.&lt;br&gt;&lt;br&gt;2) What if the product is defective?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;In case product delivered to you is defective, we’ll replace. Eligibility for replacement (e.g., imbalance or unevenness of more than 5mm, wooden joints opening, termites &amp;amp; wood borer infestations etc.).&lt;br&gt;Please note that natural characteristics of the material used, like appearance or texture (especially for solid wood products) are not defects.&lt;br&gt;&lt;br&gt;3) What if the received product is different?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;If the product delivered to is different in dimension, shape or Finish from the product image on our website, we’ll replace. Please note depending on your screen settings &amp;amp; resolution on your device there may be a slight distinctions &amp;amp; variance between the picture &amp;amp; actual product (this situation will not eligible to return the product).&lt;br&gt;&lt;br&gt;Please note: In case of returning the product, kindly make sure that the product is ready and packed in the original condition.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Cancellation Policies:&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;&lt;br&gt;1) What are the policies if customer have a change of mind after placing an order?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;In case of change of mind after placing an order, the time frame is 24hours to cancel an order (3% of the total amount paid by customer will be deducted as cancellation charges). But customized products have no such policies meaning it can’t be cancelled.&lt;br&gt;&lt;br&gt;2) What if the product is not customized, is it possible to cancel the order?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;Yes, it is possible to cancel but, it can only be cancelled before the product is shipped from our warehouse. Once the shipment is hand overed to our delivery team, we can’t cancel the order.&lt;br&gt;&lt;br&gt;3) How much cancellation charges will be applicable, while cancelling the order after 24hours?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;A cancellation fee of 6% will be applied on the amount paid by you while processing the refund.&lt;br&gt;&lt;br&gt;4) Is there any way to not get any charges deducted from the full amount paid by customer? Or Can customer use the amount afterwards for placing a new order?&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;Yes, it is possible through credit note, meaning we’ll give you a credit note of full amount paid by you &amp;amp; You can use it to place a new order. Customer can place the new order only in the same financial year, in which previous order was placed or the credit note was issued. Same cancellation charges will be applicable if the customer asks for refund, after the credit note is issued (on customer request) by Woodpeel team.&lt;br&gt;&lt;br&gt;Please Note: We don’t have refund policies except the policies mentioned above in cancellation policies section.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;Non-Eligible Return Policies:&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;Installation Issues – Wall mounting installation services are not offered by Woodpeel team &amp;amp; therefore, return requests because of customer’s inability to get the product wall mounted will not be processed.&lt;br&gt;&lt;br&gt;Relocation – After the product has been delivered to you in perfect condition, in the event of the subsequent dismantling of the product for relocation, reassembly etc. please note that Woodpeel team will not be responsible for any damage to the product.&lt;br&gt;&lt;br&gt;Wood Textures - Every single piece of wood has its own characteristics which makes every piece distinctive &amp;amp; slightly different from each other. Wood grains will vary from product to product in case of solid wood furniture.&lt;br&gt;&lt;br&gt;Primary Material &amp;amp; Secondary Material – The primary material is the main material used to manufacture the product &amp;amp; in addition to the primary material there might also be other type of materials used in the manufacturing of the product.&lt;br&gt;&lt;br&gt;Inability Of Space – It is customer’s duty to check the staircase dimensions or lift dimensions before placing the order, that the product can be delivered properly or not (Woodpeel will not take any responsibility in such situations &amp;amp; the product will be delivered till ground floor).&lt;br&gt;&lt;br&gt;Please Note: Depending on your screen settings &amp;amp; resolution on your device there may be a slight distinctions &amp;amp; variance between the picture &amp;amp; actual product.&lt;br&gt;Furniture having intricate hand-crafted details are individual unique pieces &amp;amp; may have slight distinctions &amp;amp; variance between the picture &amp;amp; actual product.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','Returns &amp; Cancellations','Returns &amp; Cancellations','Returns &amp; Cancellations'),
(5,1,'Terms &amp; Conditions','&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;This product comes with 1 year warranty, limited warranty covers manufacturing defects, termites &amp;amp; wood borer infestations. As per the industry standards, unevenness of up to 5mm is accepted widely, due to differences in floor &amp;amp; surface levels, this is not covered in warranty.&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;This limited warranty does not implement to the following issues:&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1) Normal depreciation of the product over elongated use.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2) Scratches, cuts or damages due to wrong cleaning methods or impacts/accidents.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3) Product gets damaged due to wrong installation or assembly by the customer.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4) Cracks developed due to dislocation, shifting or reshuffle of the product.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5) Fading due to exposure to upright sunlight.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6) Wood decaying due to consistent exposure to water or wetness.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7) Upholstery fabrics such as seat covers have no warranty.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;8) Use of wood-unfriendly harsh chemicals or non-norm dry-cleaning procedures.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;br&gt;\r\n&lt;/p&gt;','Terms &amp; Conditions','',''),
(6,1,'Delivery Information','&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1) Shipping address can’t be changed, once the product is shipped from our warehouse. Customer have to receive the product on the same address or the shipment will return to our warehouse.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2) Your shipment will be held for 2 days at the nearest delivery hub, if you’ve failed to receive the delivery. After this, Woodpeel reserve the right to change the location of the shipment.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3) In case of reshipping customer have to borne charges of both side transportation.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4) Our team will stay in touch with you for a hassle-free delivery.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5) Only first attempt of delivery at your shipping address is free. Customer have to borne extra delivery charges for second attempt, if a customer misses’ delivery.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6) In absence of a service lift, our delivery partner shall only make a delivery to the ground floor of your apartment. Customer have to borne extra charges per floor on delivery, to the customer’s floor (on request) in such cases.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7) If customer want time-specific or weekend delivery, then extra delivery charges will be applicable.&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Installation:&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1) Depending on the situation or condition, your product may or may not require installation assistance upon delivery.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2) If the delivery condition is:&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Pre-assembled – no installation is required, the product comes fully-assembled &amp;amp; ready to use.&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Assembly Required – expert assistance is required, for which Woodpeel provide carpenters to carry out proper installation, only in urban cities. If our carpenter is not available at your location, we’ll refund our standard installation charges (charges will be decided by Woodpeel as per the product’s condition &amp;amp; situation).&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;br&gt;\r\n&lt;/p&gt;','Delivery Information','','');
