/search>\r\n            <add position=\"before\"><![CDATA[\r\n            if ($priceslide_status == \"1\") {\r\n                    if (isset($pr)) {\r\n                        $filter_data[\'filter_price\'] = $pr;\r\n                        $filter_data[\'currency_value\'] = $currency_value;\r\n                    }\r\n                    }\r\n		]]></add>\r\n        </operation>\r\n\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n           $data[\'limits\'] = array();\r\n			]]>\r\n            </search>\r\n            <add position=\"before\"><![CDATA[\r\n            if ($priceslide_status == \"1\") {\r\n		if (isset($this->request->get[\'pr\'])) {\r\n				$url .= \'&pr=\' . $this->request->get[\'pr\'];\r\n			}\r\n			}\r\n		]]></add>\r\n        </operation>\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n           $pagination = new Pagination();\r\n			]]>\r\n            </search>\r\n            <add position=\"before\"><![CDATA[\r\n            if ($priceslide_status == \"1\") {\r\n		if (isset($this->request->get[\'pr\'])) {\r\n				$url .= \'&pr=\' . $this->request->get[\'pr\'];\r\n			}\r\n			}\r\n		]]></add>\r\n        </operation>\r\n\r\n\r\n\r\n    </file>\r\n\r\n    <file path=\"catalog/model/catalog/product.php\">\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n            return array(\r\n			]]>\r\n            </search>\r\n            <add position=\"replace\"><![CDATA[\r\n		        $product_data_array = array(\r\n		    ]]></add>\r\n        </operation>\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n                \'viewed\'           => $query->row[\'viewed\']\r\n			]]>\r\n            </search>\r\n            <add position=\"after\" offset=\"1\"><![CDATA[\r\n		        return $product_data_array;\r\n		    ]]></add>\r\n        </operation>\r\n\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n           $product_data[$result[\'product_id\']] = $this->getProduct($result[\'product_id\']);\r\n			]]>\r\n            </search>\r\n            <add position=\"replace\" index=\"1\"><![CDATA[\r\n\r\n            if (!isset($data[\'filter_price\'])) {\r\n                $product_data[$result[\'product_id\']] = $this->getProduct($result[\'product_id\']);\r\n            } else {\r\n                $filter = explode(\",\", $data[\'filter_price\']);\r\n                $product = $this->getProduct($result[\'product_id\']);\r\n                if (!empty($product[\'special\'])) {\r\n\r\n                    $special = $this->tax->calculate($product[\'special\'], $product[\'tax_class_id\'], $this->config->get(\'config_tax\'));\r\n                    if ($special >= $filter[0] && $special <= $filter[1]) {\r\n                        $product_data[$result[\'product_id\']] = $product;\r\n                    }\r\n                } else {\r\n                    $orig_price = $this->tax->calculate($product[\'price\'], $product[\'tax_class_id\'], $this->config->get(\'config_tax\'));\r\n                    if ($orig_price >= $filter[0] && $orig_price <= $filter[1]) {\r\n                        $product_data[$result[\'product_id\']] = $product;\r\n                    }\r\n                }\r\n            }\r\n\r\n		]]></add>\r\n        </operation>\r\n\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n          $sql = \"SELECT COUNT(DISTINCT p.product_id) AS total\";\r\n			]]>\r\n            </search>\r\n            <add position=\"replace\"><![CDATA[\r\n\r\n           if (!isset($data[\'filter_price\'])) {\r\n            $sql = \"SELECT COUNT(DISTINCT p.product_id) AS total\";\r\n        } else {\r\n            $sql = \"SELECT DISTINCT p.product_id\";\r\n        }\r\n\r\n		]]></add>\r\n        </operation>\r\n\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n           return $query->row[\'total\'];\r\n			]]>\r\n            </search>\r\n            <add position=\"replace\" index=\"1\"><![CDATA[\r\n\r\n       if (isset($data[\'filter_price\'])) {\r\n            $total_products = 0;\r\n            foreach ($query->rows as $result) {\r\n                $product = $this->getProduct($result[\'product_id\']);\r\n                //filtering products with price range\r\n                if (!empty($data[\'filter_price\'])) {\r\n                    $filter = explode(\",\", $data[\'filter_price\']);\r\n                    $min = $filter[0];\r\n                    $max = $filter[1];\r\n                    if ($max > 0) {\r\n\r\n                        if ($product[\'special\']) {\r\n                            $price = $product[\'special\'];\r\n                        } else {\r\n                            $price = $product[\'price\'];\r\n                        }\r\n                        $price = $this->tax->calculate($price, $product[\'tax_class_id\'], $this->config->get(\'config_tax\'));\r\n\r\n\r\n                        if ($price < $min || $price > $max) {\r\n                            continue;\r\n                        }\r\n                    }\r\n                }\r\n                $total_products++;\r\n\r\n            }\r\n            return $total_products;\r\n        }else{\r\n            return $query->row[\'total\'];\r\n        }\r\n\r\n		]]></add>\r\n        </operation>\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n                $sql .= \" LEFT JOIN \" . DB_PREFIX . \"product_description pd ON (p.product_id = pd.product_id) LEFT JOIN \" . DB_PREFIX . \"product_to_store p2s ON (p.product_id = p2s.product_id) WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\' AND p.status = \'1\' AND p.date_available <= NOW() AND p2s.store_id = \'\" . (int)$this->config->get(\'config_store_id\') . \"\'\";\r\n			]]>\r\n            </search>\r\n            <add position=\"replace\"><![CDATA[\r\n		        $sql .= \" LEFT JOIN \" . DB_PREFIX . \"product_description pd ON (p.product_id = pd.product_id) LEFT JOIN \" . DB_PREFIX . \"product_to_store p2s ON (p.product_id = p2s.product_id) LEFT JOIN \" . DB_PREFIX . \"product_special ps ON p.product_id = ps.product_id LEFT JOIN \" . DB_PREFIX . \"product_discount pds ON p.product_id = p2s.product_id WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\' AND p.status = \'1\' AND p.date_available <= NOW() AND p2s.store_id = \'\" . (int)$this->config->get(\'config_store_id\') . \"\'\";\r\n		    ]]></add>\r\n        </operation>\r\n\r\n        <operation error=\"log\">\r\n            <search><![CDATA[\r\n                public function updateViewed($product_id)\r\n            ]]>\r\n            </search>\r\n            <add position=\"before\"><![CDATA[\r\n                 public function getMinMaxProduct($data = array())\r\n    {\r\n        $min_price = $this->db->query(\"SELECT MIN(ps.price) as min_special,MIN(p.price) as min_price FROM \" . DB_PREFIX . \"product p LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p2c.product_id = p.product_id) LEFT JOIN \" . DB_PREFIX . \"product_special ps ON (ps.product_id = p.product_id) WHERE p2c.category_id = \'\" . (int)$data[\'filter_category_id\'] . \"\'\");\r\n        $max_price = $this->db->query(\"SELECT MAX(p.price) as max,p.tax_class_id, (SELECT price FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int)$this->config->get(\'config_customer_group_id\') . \"\' AND ((ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) AND (ps.date_end = \'0000-00-00\' OR ps.date_end > NOW())) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS special FROM \" . DB_PREFIX . \"product p LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p2c.product_id = p.product_id) LEFT JOIN \" . DB_PREFIX . \"product_special ps ON (ps.product_id = p.product_id) WHERE p.price = (SELECT MAX(price) FROM \" . DB_PREFIX . \"product  p LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p2c.product_id = p.product_id) WHERE p2c.category_id = \'\" . (int)$data[\'filter_category_id\'] . \"\' ) AND p2c.category_id = \'\" . (int)$data[\'filter_category_id\'] . \"\'\");\r\n\r\n        if (!empty($max_price->row[\'special\'])) {\r\n            $price = $max_price->row[\'special\'];\r\n        } else {\r\n            $price = $max_price->row[\'max\'];\r\n        }\r\n        $max = $this->tax->calculate($price, $max_price->row[\'tax_class_id\'], $this->config->get(\'config_tax\'));\r\n        if (isset($min_price->row[\'min_special\'])) {\r\n            $min = $min_price->row[\'min_special\'];\r\n        } else {\r\n            $min = $min_price->row[\'min_price\'];\r\n        }\r\n        if ($max != null){\r\n        $max = round($max);\r\n        $max = $max+(10-(substr($max,-1)));\r\n\r\n    }\r\n        $min_max = array(\r\n            \'min\' => $min,\r\n            \'max\' => $max,\r\n        );\r\n\r\n        return $min_max;\r\n    }\r\n            ]]></add>\r\n        </operation>\r\n\r\n    </file>\r\n\r\n</modification>',0,'2023-03-10 13:10:50'),
(9,12,'Recently Viewed','RecentlyViewed','','1.0','','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<modification>\r\n    <name>Recently Viewed</name>\r\n    <version>1.0</version>\r\n    <author></author>\r\n    <link></link>\r\n	<code>RecentlyViewed</code>\r\n	<!--\r\n	Start\r\n	==========================\r\n	add product id in table if customer viewed some product when logged in else set product id in cookies\r\n	==========================\r\n	-->\r	<file path=\"catalog/controller/product/product.php\">\r		<operation>\r			<search trim=\"true\"><![CDATA[if ($product_info) {]]></search>\r			<add position=\"after\"><![CDATA[\r			$this->load->model(\'extension/module/recently_viewed\');\r\n			if($this->model_extension_module_recently_viewed->isEnabled()){\r\n				if ($this->customer->isLogged()) {\r\n					$this->model_extension_module_recently_viewed->setRecentlyViewedProducts($this->customer->getId(), $product_info[\'product_id\']);\r\n				} else {\r\n				\r\n					if(isset($this->request->cookie[\'recently_viewed\']) && !empty($this->request->cookie[\'recently_viewed\'])) {\r\n						$recently_viewed = unserialize(base64_decode($this->request->cookie[\'recently_viewed\']));\r\n						$recently_viewed[$product_info[\'product_id\']] = date(\"Y-m-d H:i:s\");\r\n						// sort by in recent viewed order\r\n						uasort($recently_viewed, function($a, $b){ return strtotime($a) > strtotime($b); });\r\n						array_unique($recently_viewed); // remove duplicates\r\n					} else {\r\n						$recently_viewed[$product_info[\'product_id\']] = date(\"Y-m-d H:i:s\");\r\n					}\r\n					\r\n					$recently_viewed = base64_encode(serialize($recently_viewed));\r\n					setcookie(\'recently_viewed\', $recently_viewed, 0, \'/\', $this->request->server[\'HTTP_HOST\']);\r\n				}\r\n			}\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<!--\r\n	End\r\n	==========================\r\n	add product id in table if customer viewed some product when logged in else set product id in cookies\r\n	==========================\r\n	-->\r\n</modification>',1,'2023-03-11 22:21:00'),
(10,13,'Review Image','review_image_adding','Anas dawood','2.0','https://twitter.com/anasanwardawood','<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n  <name>Review Image</name>\r\n  <code>review_image_adding</code>\r\n  <version>2.0</version>\r\n  <author>Anas dawood</author>\r\n  <link>https://twitter.com/anasanwardawood</link>\r\n  <file path=\"admin/view/template/catalog/review_form.twig\">\r\n    <operation>\r\n      <search><![CDATA[</form>]]></search>\r\n      <add position=\"before\"><![CDATA[<div class=\"table-responsive\">\r\n        <div class=\"col-sm-2\"></div>\r\n        <div class=\"col-sm-10 control-label\">\r\n            <table id=\"images\" class=\"table table-striped table-bordered table-hover\">\r\n                <thead>\r\n                    <tr>\r\n                        <td class=\"text-left\">{{ entry_image }}</td>\r\n                        <td></td>\r\n                    </tr>\r\n                </thead>\r\n                <tbody>\r\n                    {% set image_row = 0 %}\r\n                    {% for review_image in review_images %}\r\n                        <tr id=\"image-row{{ image_row }}\">\r\n                            <td class=\"text-left\"><div class=\"image\"><img src=\"data:{{ review_image.type }};base64,{{ review_image.thumb }}\" alt=\"\" id=\"thumb{{ image_row }}\" width=\"100\" height=\"100\" />\r\n                                    <input type=\"hidden\" name=\"review_image[{{ image_row }}][image]\" value=\"{{ review_image.thumb }}\" id=\"review_image{{ image_row }}\" />\r\n                                    <input type=\"hidden\" name=\"review_image[{{ image_row }}][type]\" value=\"{{ review_image.type }}\" id=\"review_image{{ image_row }}\" />\r\n                                    <input type=\"hidden\" name=\"review_image[{{ image_row }}][size]\" value=\"{{ review_image.size }}\" id=\"review_image{{ image_row }}\" />\r\n                                    <input type=\"hidden\" name=\"review_image[{{ image_row }}][name]\" value=\"{{ review_image.name }}\" id=\"review_image{{ image_row }}\" />\r\n                                    <br />\r\n                            <td class=\"text-left\"><a onclick=\"$(\'#image-row{{ image_row }}\').remove();\" class=\"button\" style=\"cursor: pointer;\">{{button_remove}}</a></td>\r\n                        </tr>\r\n                        {% set image_row = image_row + 1 %}\r\n                    {% endfor %}\r\n                </tbody>\r\n                <tfoot>\r\n                    <tr>\r\n                        <td></td>\r\n                        <td class=\"text-left\"><a onclick=\"addImage();\" class=\"btn btn-warning\">{{ button_image_add }}</a></td>\r\n                    </tr>\r\n                </tfoot>\r\n            </table>\r\n        </div>\r\n    </div>  ]]></add>\r\n    </operation>\r\n    <operation>\r\n            <search><![CDATA[{{ footer }}]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                <script type=\"text/javascript\"><!--\r\n                    var image_row = {{ image_row }};\r\n\r\n                    function addImage() {\r\n                        html  = \'<tr id=\"image-row\' + image_row + \'\">\';\r\n                      html += \'    <td class=\"text-left\"><div class=\"image\"><img src=\"{{ placeholder }}\" alt=\"\" id=\"thumb\' + image_row + \'\" width=100 height=100 />\';\r\n                      html += \'    <br /><input type=\"file\" onchange=\"previewFile(\' + image_row + \')\" name=\"image\' + image_row + \'\" id=\"image\' + image_row + \'\" />\';\r\n                      html += \'    <td class=\"text-left\"><a onclick=\"$(\\\'#image-row\' + image_row  + \'\\\').remove();\" class=\"button\" style=\"cursor: pointer;\">{{ button_remove }}</a></td>\';\r\n                      html += \'  </tr>\';\r\n                      \r\n                      $(\'#images tbody\').append(html);\r\n                      \r\n                      image_row++;\r\n                    }\r\n                    //--></script>\r\n                \r\n                \r\n                <script type=\"text/javascript\"><!--\r\n                    function previewFile(row) {\r\n                            var preview = document.getElementById(\'thumb\'+row);\r\n                            var file    = document.getElementById(\'image\'+row).files[0];\r\n                            var reader  = new FileReader();\r\n\r\n                            reader.onloadend = function () {\r\n                              preview.src = reader.result;\r\n                            }\r\n\r\n                            if (file) {\r\n                              reader.readAsDataURL(file);\r\n                            } else {\r\n                              preview.src = \"{{ placeholder }}\";\r\n                            }\r\n                          }\r\n                    //--></script>\r\n            ]]></add>\r\n        </operation>\r\n  </file>\r\n  \r\n  <file path=\"admin/controller/catalog/review.php\">\r\n    <operation>\r\n      <search><![CDATA[$this->response->setOutput($this->load->view(\'catalog/review_form\', $data));]]></search>\r\n      <add position=\"before\"><![CDATA[$this->load->model(\'tool/image\');\r\n        $data[\'placeholder\'] = $this->model_tool_image->resize(\'no_image.png\', 100, 100);\r\n        // Images\r\n        if (isset($this->request->get[\'review_id\'])) {\r\n            $review_images = $this->model_catalog_review->getReviewImages($this->request->get[\'review_id\']);\r\n        } else {\r\n            $review_images = array();\r\n        }\r\n\r\n        $data[\'review_images\'] = array();\r\n        foreach ($review_images as $review_image) {\r\n            if (isset($review_image[\'data\'])) {\r\n                $image = $review_image[\'data\'];\r\n                $thumb = base64_encode($image);\r\n                $type = $review_image[\'mime\'];\r\n                $size = $review_image[\'image_size\'];\r\n                $name = $review_image[\'image_name\'];\r\n            } else {\r\n                $image = \'\';\r\n                $thumb = \'no_image.png\';\r\n                $type = \'\';\r\n                $size = \'\';\r\n                $name = \'\';\r\n            }\r\n            $data[\'review_images\'][] = array(\r\n                \'image\' => $image,\r\n                \'thumb\' => $thumb,\r\n                \'type\' => $type,\r\n                \'size\' => $size,\r\n                \'name\' => $name,\r\n            );\r\n        }\r\n\r\n\r\n\r\n        $data[\'text_browse\'] = $this->language->get(\'text_browse\');\r\n        $data[\'text_clear\'] = $this->language->get(\'text_clear\');\r\n        $data[\'text_no_results\'] = $this->language->get(\'text_no_results\');\r\n        $data[\'text_image_manager\'] = $this->language->get(\'text_image_manager\');\r\n        $data[\'entry_sort_order\'] = $this->language->get(\'entry_sort_order\');\r\n        $data[\'entry_image\'] = $this->language->get(\'entry_image\');\r\n        $data[\'button_add_image\'] = $this->language->get(\'button_add_image\');\r\n        $data[\'button_remove\'] = $this->language->get(\'button_remove\');]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[$this->model_catalog_review->addReview($this->request->post);]]></search>\r\n      <add position=\"replace\"><![CDATA[$review_id = $this->model_catalog_review->addReview($this->request->post);\r\n            \r\n            $files = array();\r\n            $oldFiles = array();\r\n\r\n            if (!empty($this->request->files) && is_array($this->request->files) && isset($review_id)) {\r\n                foreach ($this->request->files as $key) {\r\n                    if ($key[\'name\'] != \"\") {\r\n                        $files[] = array(\r\n                            \'name\' => $key[\'name\'],\r\n                            \'type\' => $key[\'type\'],\r\n                            \'tmp_name\' => $key[\'tmp_name\'],\r\n                            \'error\' => $key[\'error\'],\r\n                            \'size\' => $key[\'size\']\r\n                        );\r\n                    }\r\n                }\r\n                \r\n                $this->model_catalog_review->editReviewImages($review_id, $files, $oldFiles);\r\n            }]]></add>\r\n    </operation>\r\n    <operation>\r\n            <search><![CDATA[$this->model_catalog_review->editReview($this->request->get[\'review_id\'], $this->request->post);]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n               $files = array();\r\n            $oldFiles = array();\r\n\r\n            if (!empty($this->request->files) && is_array($this->request->files)) {\r\n                foreach ($this->request->files as $key) {\r\n                    if ($key[\'name\'] != \"\") {\r\n                        $files[] = array(\r\n                            \'name\' => $key[\'name\'],\r\n                            \'type\' => $key[\'type\'],\r\n                            \'tmp_name\' => $key[\'tmp_name\'],\r\n                            \'error\' => $key[\'error\'],\r\n                            \'size\' => $key[\'size\']\r\n                        );\r\n                    }\r\n                }\r\n            }\r\n\r\n\r\n            if (!empty($this->request->post[\'review_image\']) && is_array($this->request->post[\'review_image\'])) {\r\n                foreach ($this->request->post[\'review_image\'] as $key2) {\r\n                    if ($key2[\'name\'] != \"\") {\r\n                        $oldFiles[] = array(\r\n                            \'name\' => $key2[\'name\'],\r\n                            \'type\' => $key2[\'type\'],\r\n                            \'tmp_name\' => $key2[\'image\'],\r\n                            \'size\' => $key2[\'size\']\r\n                        );\r\n                    }\r\n                }\r\n            }\r\n            $this->model_catalog_review->editReviewImages($this->request->get[\'review_id\'], $files, $oldFiles);\r\n            ]]></add>\r\n        </operation>\r\n  </file>\r\n  \r\n  <file path=\"admin/model/catalog/review.php\">\r\n        <operation>\r\n            <search><![CDATA[public function deleteReview($review_id) {]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n               public function editReviewImages($review_id, $data,$oldData) {\r\n		$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"review_image WHERE review_id = \'\" . (int)$review_id . \"\'\");\r\n\r\n		if (isset($data)) {\r\n			foreach ($data as $review_image) {\r\n				$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"review_image SET review_id = \'\" . (int)$review_id . \"\', image_name = \'\" . $this->db->escape($review_image[\'name\']) . \"\', mime = \'\" . $review_image[\'type\'] . \"\', data = \'\" . addslashes(file_get_contents($review_image[\'tmp_name\'])) . \"\', image_size = \'\" . $review_image[\'size\'] . \"\'\");\r\n			}\r\n		}\r\n                if (isset($oldData)) {\r\n			foreach ($oldData as $review_image_old) {\r\n				$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"review_image SET review_id = \'\" . (int)$review_id . \"\', image_name = \'\" . $this->db->escape($review_image_old[\'name\']) . \"\', mime = \'\" . $review_image_old[\'type\'] . \"\', data = \'\" . addslashes(base64_decode($review_image_old[\'tmp_name\'])) . \"\', image_size = \'\" . $review_image_old[\'size\'] . \"\'\");\r\n			}\r\n		}\r\n	}\r\n	\r\n	public function getReviewImages($review_id) {\r\n		$query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"review_image WHERE review_id = \'\" . (int)$review_id . \"\'\");\r\n\r\n		return $query->rows;\r\n	}\r\n            ]]></add>\r\n        </operation>\r\n		<operation>\r\n            <search><![CDATA[public function deleteReview($review_id) {]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n			$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"review_image WHERE review_id = \'\" . (int)$review_id . \"\'\");\r\n              \r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n    \r\n  <file path=\"admin/language/*/catalog/review.php\">\r\n        <operation error=\"log\" info=\"Text File in admin\">\r\n            <search><![CDATA[$_[\'heading_title\']]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                $_[\'entry_image\']       = \'Image\';\r\n				$_[\'entry_sort_order\']  = \'Sort Order\';\r\n				$_[\'text_browse\']       = \'Brows\';\r\n				$_[\'text_clear\']        = \'Clear\';\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n    \r\n  <file path=\"catalog/language/*/product/product.php\">\r\n        <operation error=\"log\" info=\"Edit image code while inserting in catalog\">\r\n            <search><![CDATA[$_[\'text_search\']]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                $_[\'entry_image\']       = \'Image\';\r\n				$_[\'entry_sort_order\']  = \'Sort Order\';\r\n				$_[\'text_browse\']       = \'Brows\';\r\n				$_[\'text_clear\']        = \'Clear\';\r\n				$_[\'button_image_add\']  = \'Add Image\';\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n    \r\n  <file path=\"catalog/controller/product/product.php\">\r\n        <operation error=\"log\" info=\"getReviewImages\">\r\n            <search><![CDATA[\'date_added\' => date($this->language->get(\'date_format_short\'), strtotime($result[\'date_added\']))]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n			,\r\n                \'images\'     => $this->model_catalog_review->getReviewImages($result[\'review_id\'])\r\n               \r\n            ]]></add>\r\n        </operation>\r\n		<operation error=\"log\" info=\"model_catalog_review->addReview\">\r\n            <search><![CDATA[$this->model_catalog_review->addReview($this->request->get[\'product_id\'], $this->request->post);]]></search>\r\n            <add position=\"replace\"><![CDATA[\r\n		$files = [];\r\n                if (!empty($this->request->files) && is_array($this->request->files)) {\r\n                    foreach ($this->request->files as $key) {\r\n                        if ($key[\'name\'] != \"\") {\r\n                            $files[] = array(\r\n                                \'name\' => $key[\'name\'],\r\n                                \'type\' => $key[\'type\'],\r\n                                \'tmp_name\' => $key[\'tmp_name\'],\r\n                                \'error\' => $key[\'error\'],\r\n                                \'size\' => $key[\'size\']\r\n                            );\r\n                        }\r\n                    }\r\n                }\r\n                $this->model_catalog_review->addReview($this->request->get[\'product_id\'], $this->request->post,$files);\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n    \r\n  <file  path=\"catalog/model/catalog/review.php\">\r\n      <operation>\r\n          <search><![CDATA[public function addReview($product_id, $data)]]></search>\r\n          <add position=\"replace\"><![CDATA[public function addReview($product_id, $data,$files = null)]]></add>\r\n      </operation>\r\n      \r\n      <operation>\r\n          <search><![CDATA[$this->db->getLastId();]]></search>\r\n          <add position=\"after\"><![CDATA[\r\n          if($files != null)\r\n                {\r\n                    $this->editReviewImages($review_id, $files);\r\n                }\r\n                ]]></add>\r\n      </operation>\r\n      \r\n        <operation error=\"log\" info=\"getReviewImages\">\r\n            <search><![CDATA[public function getTotalReviewsByProductId($product_id)]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                public function getReviewImages($review_id) {\r\n		$query = $this->db->query(\"SELECT data , mime FROM \" . DB_PREFIX . \"review_image WHERE review_id = \'\" . (int)$review_id . \"\'\");\r\n                $images = [];\r\n                foreach($query->rows as $i=>$image)\r\n                {\r\n                    $images[$i][\'data\'] = base64_encode($image[\'data\']);\r\n                    $images[$i][\'mime\'] = $image[\'mime\'];\r\n                    \r\n                }\r\n		return $images;\r\n	}\r\n	\r\n	 public function editReviewImages($review_id, $data) {\r\n		$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"review_image WHERE review_id = \'\" . (int)$review_id . \"\'\");\r\n\r\n		if (isset($data)) {\r\n			foreach ($data as $review_image) {\r\n				$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"review_image SET review_id = \'\" . (int)$review_id . \"\', image_name = \'\" . $this->db->escape($review_image[\'name\']) . \"\', mime = \'\" . $review_image[\'type\'] . \"\', data = \'\" . addslashes(file_get_contents($review_image[\'tmp_name\'])) . \"\', image_size = \'\" . $review_image[\'size\'] . \"\'\");\r\n			}\r\n		}\r\n	}\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n    \r\n  <file path=\"catalog/view/theme/*/template/product/review.twig\">\r\n    <operation>\r\n        <search position=\"after\"><![CDATA[</table>]]></search>\r\n        <add><![CDATA[\r\n           {% for review_image in review.images %}\r\n        <div class=\"image col-xs-6\" style=\"border: 1px solid grey;\">\r\n            <img src=\"data:{{ review_image.mime }};base64,{{ review_image.data }}\" alt=\"\" width=\"100\" height=\"100\"/>\r\n        </div>\r\n    {% endfor %}\r\n        ]]></add>\r\n    </operation>\r\n</file>\r\n\r\n  <file path=\"catalog/view/theme/*/template/product/product.twig\">	\r\n		<operation>\r\n            <search position=\"replace\"><![CDATA[data: $(\"#form-review\").serialize(),]]></search>\r\n            <add><![CDATA[\r\n              data: new FormData($(\'#form-review\')[0]),\r\n                cache: false,\r\n                contentType: false,\r\n                processData: false,\r\n				 error: function(xhr, ajaxOptions, thrownError) {\r\n					alert(thrownError + \"\\r\\n\" + xhr.statusText + \"\\r\\n\" + xhr.responseText);\r\n				},\r\n            ]]></add>\r\n        </operation>\r\n		\r\n		<operation>\r\n            <search position=\"replace\"><![CDATA[<form class=\"form-horizontal\" id=\"form-review\">]]></search>\r\n            <add><![CDATA[\r\n               <form class=\"form-horizontal\" id=\"form-review\" enctype=\"multipart/form-data\">\r\n            ]]></add>\r\n        </operation>\r\n		\r\n		<operation>\r\n            <search><![CDATA[{{ captcha }}]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n            <br /> <br />\r\n               <div class=\"table-responsive\">\r\n                    <table id=\"review-images\" class=\"table table-striped table-bordered table-hover\">\r\n                        <thead>\r\n                            <tr>\r\n                                <td class=\"text-left\">{{ entry_image }}</td>\r\n                                <td></td>\r\n                            </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                            {% set image_row = 0 %}\r\n                            <tr id=\"image-row{{ image_row }}\">\r\n                                <td class=\"text-left\"><div class=\"image\"><img src=\"\" alt=\"\" id=\"thumb{{ image_row }}\" width=\"100\" height=\"100\" />\r\n                                        <input type=\"file\" onchange=\"previewFile({{image_row}})\" name=\"image{{image_row}}\" id=\"image{{image_row}}\" />\r\n                                </div> </td>\r\n\r\n                                <td class=\"text-left\"><a onclick=\"$(\'#image-row{{ image_row }}\').remove();\" class=\"button\" style=\"cursor: pointer;\">{{button_remove}}</a></td>\r\n                            </tr>\r\n                            {% set image_row = image_row + 1 %}\r\n                        </tbody>\r\n                        <tfoot>\r\n                            <tr>\r\n                                <td></td>\r\n                                <td class=\"text-left\"><a onclick=\"addImage();\" class=\"btn btn-warning\">{{ button_image_add }}</a></td>\r\n                            </tr>\r\n                        </tfoot>\r\n                    </table>\r\n            </div>   \r\n            ]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[{{ footer }}]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                <script type=\"text/javascript\"><!--\r\n                    var image_row = {{ image_row }};\r\n\r\n                    function addImage() {\r\n                        html  = \'<tr id=\"image-row\' + image_row + \'\">\';\r\n                      html += \'    <td class=\"text-left\"><div class=\"image\"><img src=\"{{ placeholder }}\" alt=\"\" id=\"thumb\' + image_row + \'\" width=100 height=100 />\';\r\n                      html += \'    <br /><input type=\"file\" onchange=\"previewFile(\' + image_row + \')\" name=\"image\' + image_row + \'\" id=\"image\' + image_row + \'\" />\';\r\n                      html += \'    </div></td>\';\r\n                      html += \'    <td class=\"text-left\"><a onclick=\"$(\\\'#image-row\' + image_row  + \'\\\').remove();\" class=\"button\" style=\"cursor: pointer;\">{{ button_remove }}</a></td>\';\r\n                      html += \'  </tr>\';\r\n                      \r\n                      $(\'#review-images tbody\').append(html);\r\n                      \r\n                      image_row++;\r\n                    }\r\n                    //--></script>\r\n                \r\n                \r\n                <script type=\"text/javascript\"><!--\r\n                    function previewFile(row) {\r\n                            var preview = document.getElementById(\'thumb\'+row);\r\n                            var file    = document.getElementById(\'image\'+row).files[0];\r\n                            var reader  = new FileReader();\r\n\r\n                            reader.onloadend = function () {\r\n                              preview.src = reader.result;\r\n                            }\r\n\r\n                            if (file) {\r\n                              reader.readAsDataURL(file);\r\n                            } else {\r\n                              preview.src = \"{{ placeholder }}\";\r\n                            }\r\n                          }\r\n                    //--></script>    \r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n</modification>',1,'2023-03-12 12:07:51'),
(11,14,'City / Area / Pincode based produdcts and delivery charges','pbdp','CartBinder','17.2','https://www.cartbinder.com/store/','<modification>\n	<name>City / Area / Pincode based produdcts and delivery charges</name>\n	<version>17.2</version>\n	<link>https://www.cartbinder.com/store/</link>\n	<author>CartBinder</author>\n	<code>pbdp</code>\n	<file path=\"admin/controller/common/column_left.php\">\n		<operation>\n			<search><![CDATA[if ($system) {]]></search>\n			<add position=\"before\"><![CDATA[\n				$pbdp = array();\n				if ($this->user->hasPermission(\'access\', \'extension/module/pbdp\')) {\n					$pbdp[] = array(\n						\'name\'	   => $this->language->get(\'text_majorcities\'),\n						\'href\'     => $this->url->link(\'extension/module/pbdp\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n						\'children\' => array()\n					);\n				}\n				if ($this->user->hasPermission(\'access\', \'extension/module/pbdp\')) {\n					$pbdp[] = array(\n						\'name\'	   => $this->language->get(\'text_producttocity\'),\n						\'href\'     => $this->url->link(\'extension/module/pbdp/assignProducts\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n						\'children\' => array()\n					);\n				}\n				if ($this->user->hasPermission(\'access\', \'extension/module/pbdp\')) {\n					$pbdp[] = array(\n						\'name\'	   => $this->language->get(\'text_pinlist\'),\n						\'href\'     => $this->url->link(\'extension/module/pbdp/getTownList\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n						\'children\' => array()\n					);\n				}\n				if ($this->user->hasPermission(\'access\', \'extension/module/pbdp\')) {\n					$pbdp[] = array(\n						\'name\'	   => $this->language->get(\'text_pinimport\'),\n						\'href\'     => $this->url->link(\'extension/module/pbdp/getTownImportForm\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n						\'children\' => array()\n					);\n				}\n				if ($this->user->hasPermission(\'access\', \'extension/module/pbdp\')) {\n					$pbdp[] = array(\n						\'name\'	   => $this->language->get(\'text_pinsetting\'),\n						\'href\'     => $this->url->link(\'extension/module/pbdp/settings\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n						\'children\' => array()\n					);\n				}\n				\n				if ($pbdp) {\n					$data[\'menus\'][] = array(\n						\'id\'       => \'menu-pbdp\',\n						\'name\'	   => $this->language->get(\'text_pin\'),\n						\'icon\'	   => \'fa-map-marker\', \n						\'href\'     => \'\',\n						\'children\' => $pbdp	\n					);\n				}\n				]]></add>\n		</operation>\n	</file>\n	<file path=\"admin/language/*/common/column_left.php\">\n		<operation>\n			<search><![CDATA[\n				$_[\'text_zone\']\n				]]>\n			</search>\n			<add position=\"before\">\n				<![CDATA[\n				$_[\'text_pin\']              = \'Products Delivery\';\n				$_[\'text_pinlist\']        = \'Areas\';\n				$_[\'text_pinsetting\']    = \'Settings\';\n				$_[\'text_pinimport\']    = \'Import Areas\';\n				$_[\'text_producttocity\']    = \'Product to city\';\n				$_[\'text_majorcities\']    = \'Cities\';\n				]]>\n			</add>\n		</operation>\n	</file>\n	<file path=\"catalog/controller/product/product.php\">\n		<operation>\n			<search><![CDATA[$data[\'model\'] = $product_info[\'model\'];]]>\n			</search>\n			<add position=\"before\"><![CDATA[\n				$this->language->load(\'extension/module/pbdp\');\n				$data[\'pbdp_fontcolor\'] = $this->config->get(\'pbdp_fontcolor\');\n				$data[\'pbdp_backgroundcolor\'] = $this->config->get(\'pbdp_backgroundcolor\');\n				$data[\'entry_newpincode\'] = $this->language->get(\'entry_newpincode\');\n				$this->load->model(\"extension/module/pbdp\");\n				$data[\'messagedetails\'] = $this->model_extension_module_pbdp->productDetails($this->request->get[\'product_id\']);\n				if(isset($this->session->data[\'shipping_postcode\']) && $this->config->get(\'pbdp_showcod\') && $data[\'messagedetails\'][\'available\']) {\n					$data[\'paymentCheck\'] = $this->model_extension_module_pbdp->paymentCheck($this->session->data[\'shipping_postcode\'],\'cod\');\n				} else {\n					$data[\'paymentCheck\'] = \"\";\n					if(!$this->config->get(\"pbdp_addtocartdisable\")) {\n						$data[\'messagedetails\'][\'available\'] = 1;\n					}\n				}\n			]]>\n			</add>\n		</operation>\n	</file>\n	<file path=\"catalog/view/theme/*/template/product/product.twig\">\n		 <operation>\n	      <search index=\"0\"><![CDATA[{% if price]]></search>\n	      <add position=\"before\"><![CDATA[\n	       <div class=\"plocationbox\" style=\"background:{{ pbdp_backgroundcolor }};color:{{ pbdp_fontcolor }};\">\n	      {% if messagedetails is defined %}\n	      <span class=\"codcheck\">{{ paymentCheck }}</span>\n	      {{ messagedetails.shippingprice }}\n	      {% if messagedetails.shippingmethods is defined and messagedetails.shippingmethods %}\n	      {{ messagedetails.shippingmethods }}<br>\n	      {% endif %}\n	      <span class=\"deliverymessage\">{{ messagedetails.html }}</span>\n	      <span class=\"hoursglass\"><img src=\"catalog/view/theme/default/image/hourglass.gif\"></span>\n	      <div class=\"newpincode\" style=\"display:none;\">\n	             <div class=\"pincode\">\n	              	<div id=\"mainsearchbox\" class=\"input-group\">\n					   <input type=\"text\" name=\"areaname\"  value=\"\" placeholder=\"{{ entry_newpincode }}\" class=\"form-control input-lg\">\n					  <span class=\"input-group-btn\">\n					   <button type=\"button\" class=\"btn btn-primary-outline btn-lg postcodesearch\" onclick=\"\"><img src=\"catalog/view/theme/default/image/go.png\"></button>\n					  </span>\n					</div>\n	            	<label class=\"error\"></label>\n	            </div>\n	            <div class=\"pmessage\" style=\"color:{{ pbdp_backgroundcolor }};background:{{ pbdp_fontcolor }};\"></div>\n	        </div>\n	        {% endif %}\n	      </div>\n	        ]]>\n	      </add>\n	    </operation>\n			 <operation>\n		      <search><![CDATA[<button type=\"button\" id=\"button-cart\"]]></search>\n		      <add position=\"replace\"><![CDATA[<button {{ messagedetails.available ? \"\":\"disabled style=\'opacity:0.6;\'\" }} type=\"button\" id=\"button-cart\"]]></add>\n	    	</operation>\n		</file>\n	<file path=\"catalog/controller/common/header.php\">\n		<operation>\n			<search><![CDATA[$this->load->language(\'common/header\');]]>\n			</search>\n			<add position=\"after\"><![CDATA[\n				if(isset($this->session->data[\'areaname\']) && $this->session->data[\'areaname\']) {\n					$data[\'areaname\'] = $this->session->data[\'areaname\'];\n				} else { 	\n					$data[\'areaname\']  = \"Area / Pincode\";\n				}\n			]]>\n			</add>\n		</operation>\n	</file>\n	<file path=\"catalog/controller/common/footer.php\">\n		<operation>\n			<search><![CDATA[$this->load->language(\'common/footer\');]]>\n			</search>\n			<add position=\"after\"><![CDATA[\n				$footersettings = array();\n				$data[\'pbdp_footer\'] = $this->load->controller(\"extension/module/pbdp/footer\",$footersettings);	\n			]]>\n			</add>\n		</operation>\n	</file>\n	<file path=\"catalog/view/theme/*/template/common/footer.twig\">\n		<operation>\n			<search><![CDATA[</body>]]>\n			</search>\n			<add position=\"before\"><![CDATA[\n				{% if pbdp_footer is defined and pbdp_footer %}\n				{{ pbdp_footer }}\n				{% endif %}\n				]]>\n			</add>\n		</operation>\n	</file>\n	<file path=\"catalog/controller/checkout/payment_method.php\">\n		<operation>\n			<search><![CDATA[$results = $this->model_setting_extension->getExtensions(\'payment\');]]>\n			</search>\n			<add position=\"after\"><![CDATA[\n						if(isset($this->session->data[\'shipping_postcode\']) && $this->config->get(\"pbdp_pinpayment\")) {\n							if($this->config->get(\'pbdp_zerocityselection\')) {\n								if ($this->cart->hasAllByPassProducts()) {\n									goto byPassPaymentChecking;\n								}\n							}\n							$this->load->model(\'extension/module/pbdp\');\n							$payments = $this->model_extension_module_pbdp->getPayments($this->ses