    	if($this->config->get(\'pbdp_zerocityselection\')) {\n	    		$hasallbypassproduct = true;\n				foreach ($this->getProducts() as $product) {\n					if (!$product[\'bypassproduct\']) {\n						$hasallbypassproduct = false;\n						break;\n					}\n				}\n			}\n			return $hasallbypassproduct;\n    	}\n    	]]>\n    </add>\n  </operation>\n  </file>\n   <file path=\"admin/controller/catalog/product.php\">\n  <operation>\n    <search><![CDATA[if (isset($this->request->post[\'price\'])) {]]>\n    </search>\n    <add position=\"before\"><![CDATA[\n      $this->load->model(\'extension/module/pbdp\');\n		$data[\'entry_majorcity\'] = \"Select Delivery Cities:<br><small>Assign products to multiple pincodes by selecting the city</small> \";\n		$data[\'entry_pincodes\'] = \"Enter Pincodes:<br><small>If you delivery only to small number of pincodes, enter it here separated by comma.</small> \";\n		$data[\'entry_pincodes_shipping\'] = \"Pincodes Shipping Charge<br><small>Enter shipping charge for above comma separated pincodes</small> \";\n		$data[\'majorcities\'] = $this->model_extension_module_pbdp->getpingroups();\n\n		$data[\'product_majorcity\'] = array();\n		if (isset($this->request->post[\'product_majorcity\'])) {\n			$product_majorcity = $this->request->post[\'product_majorcity\'];\n			foreach ($product_majorcity as $key => $value) {\n				if(isset($value[\'pingroup_id\'])) {\n					$data[\'product_majorcity\'][$value[\'pingroup_id\']] = $value[\'shippingprice\'];\n				}\n			}\n		} elseif (isset($this->request->get[\'product_id\'])) {\n			$data[\'product_majorcity\'] = $this->model_extension_module_pbdp->getGroupsById($this->request->get[\'product_id\']);\n		}\n\n		$data[\'pincodes\']  = \"\";\n		if (isset($this->request->post[\'pincodes\'])) {\n			$data[\'pincodes\'] = $this->request->post[\'pincodes\'];\n		} elseif (isset($this->request->get[\'product_id\'])) {\n			$pincodes = $this->model_extension_module_pbdp->getPincodes($this->request->get[\'product_id\']);\n			if(!empty($pincodes)) {\n				  $data[\'pincodes\'] = implode(\",\",$pincodes[\'pincodes\']);\n			}\n		} \n\n		if (isset($this->request->post[\'pincodes_shippingprice\'])) {\n			$data[\'pincodes_shippingprice\'] = $this->request->post[\'pincodes_shippingprice\'];\n		} elseif (!empty($pincodes)) {\n			$data[\'pincodes_shippingprice\'] = $pincodes[\'pincodes_shippingprice\'];\n		} else {\n			$data[\'pincodes_shippingprice\'] = 0;\n		}\n\n      ]]>\n    </add>\n  </operation>\n  </file>\n  <file path=\"admin/model/catalog/product.php\">\n  	    <operation>\n      <search><![CDATA[if (isset($data[\'product_attribute\'])) {]]>\n      </search>\n      <add position=\"before\"><![CDATA[\n      	if(isset($data[\'product_majorcity\'])) {\n			foreach ($data[\'product_majorcity\'] as $key => $value) {\n			  if(isset($value[\'pingroup_id\'])) {\n				$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"product_to_pingroup SET product_id = \'\" . (int)$product_id . \"\', pingroup_id = \'\" . (int)$value[\'pingroup_id\'] . \"\',shippingprice = \'\" . (float)$value[\'shippingprice\'] . \"\'\");\n				}\n			}\n		}\n		if(isset($data[\'pincodes\']) && $data[\'pincodes\'] != \"\") {\n      	 	$pingroupids = array();\n			$pinlist = explode(\",\",$data[\'pincodes\']);\n	        $pinlist  = array_unique($pinlist);\n			foreach($pinlist as $key => $pincode) {\n	        	$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"product_to_pincode SET product_id = \'\" . (int)$product_id . \"\', pincode = \'\" . $pincode . \"\', pincodes_shippingprice = \'\".(float)$data[\'pincodes_shippingprice\'].\"\'\");\n	        }\n		}	\n    ]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[if (!empty($data[\'product_attribute\'])) {]]>\n      </search>\n      <add position=\"before\"><![CDATA[\n        $this->db->query(\"DELETE FROM \" . DB_PREFIX . \"product_to_pingroup WHERE product_id = \'\" . (int)$product_id . \"\'\");\n        if(isset($data[\'product_majorcity\'])) {\n			foreach ($data[\'product_majorcity\'] as $key => $value) {\n				 if(isset($value[\'pingroup_id\'])) {\n					$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"product_to_pingroup SET product_id = \'\" . (int)$product_id . \"\', pingroup_id = \'\" . (int)$value[\'pingroup_id\'] . \"\',shippingprice = \'\" . (float)$value[\'shippingprice\'] . \"\'  \");\n				}\n			}\n		}\n		$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"product_to_pincode WHERE product_id = \'\" . (int)$product_id . \"\'\");\n        if(isset($data[\'pincodes\']) && $data[\'pincodes\'] != \"\") {\n	        $pingroupids = array();\n			$pinlist = explode(\",\",$data[\'pincodes\']);\n	        $pinlist  = array_unique($pinlist);\n	        foreach($pinlist as $key => $pincode) {\n	        	$this->db->query(\"INSERT INTO \" . DB_PREFIX . \"product_to_pincode SET product_id = \'\" . (int)$product_id . \"\', pincode = \'\" . $pincode . \"\', pincodes_shippingprice = \'\".(float)$data[\'pincodes_shippingprice\'].\"\'\");\n	        }\n		}\n        ]]></add>\n    </operation>\n     <operation>\n      <search><![CDATA[$data[\'product_attribute\'] = $this->getProductAttributes($product_id);]]>\n      </search>\n      <add position=\"after\"><![CDATA[\n      	$this->load->model(\'extension/module/pbdp\');\n       	$data[\'product_majorcity\'] = $this->model_extension_module_pbdp->getProductLocations($product_id);\n        ]]></add>\n    </operation>\n  </file>\n \n  <file path=\"admin/view/template/catalog/product_form.twig\">\n    <operation>\n      <search><![CDATA[<label class=\"col-sm-2 control-label\">{{ entry_store }}</label>]]>\n      </search>\n      <add position=\"before\"><![CDATA[\n      	<script>\n        	function uncheckallboxes() {\n            $(\".case\").each(function(){\n                if($(this).prop(\"checked\", true)) {\n                    $(this).prop(\"checked\", false);\n                } else {\n                    $(this).prop(\"checked\", false);\n                }                \n            });\n       		}\n       		function checkallboxes() {\n            $(\".case\").each(function(){\n                if($(this).prop(\"checked\", false)) {\n                    $(this).prop(\"checked\", true);\n                }              \n            });\n       		}\n        </script>\n        <label class=\"col-sm-2 control-label\">{{ entry_majorcity }}</label>\n        <div class=\"col-sm-10 citycheckbox\">\n          <div class=\"table-responsive well well-sm\" style=\"height: 300px; overflow: auto;\">\n            {% for key,majorcity in majorcities %}\n            <table class=\"table table-bordered table-hover\" id=\"city{{ majorcity.name }}\">\n              <tr>\n                 {% if product_majorcity[majorcity.pingroup_id] is defined %}\n                 <td style=\"width: 1px;\">\n                <input type=\"checkbox\" name=\"product_majorcity[{{ key }}][pingroup_id]\" value=\"{{ majorcity.pingroup_id }}\" checked=\"checked\"  class=\"case\" />\n            </td>\n            <td style=\"width: 15%;\">\n                {{ majorcity.name }} \n</td>\n<td>\n                <input type=\"text\" placeholder=\"Enter Shipping Charge\" name=\"product_majorcity[{{ key }}][shippingprice]\" value=\"{{ product_majorcity[majorcity.pingroup_id] }}\" class=\"form-control\" style=\"width:60%;display:inline-block;\" />\n            </td>\n                {% else %}\n                <td style=\"width: 1px;\">\n                <input type=\"checkbox\" name=\"product_majorcity[{{ key }}][pingroup_id]\" value=\"{{ majorcity.pingroup_id }}\" class=\"case\" />\n                </td>\n                 <td style=\"width: 15%;\">\n                {{ majorcity.name }}\n                </td>\n                 &nbsp &nbsp\n                 <td>\n                 <input type=\"text\" placeholder=\"Enter Shipping Charge\" name=\"product_majorcity[{{ key }}][shippingprice]\" value=\"\" class=\"form-control\" style=\"width:60%;display:inline-block;\" />\n                 </td>\n                {% endif %}\n              </tr>\n            </table>\n            {% endfor %}\n          </div>\n          <div class=\"selectboxescity\">\n          	<label onclick=\'checkallboxes();\' class=\"btn btn-primary\"> Select All </label>\n          	<label onclick=\'uncheckallboxes();\' class=\"btn btn-primary\"> UnSelect All </label>\n    	 </div>\n        </div>\n        \n      </div>\n        <div class=\"form-group\">\n        <label class=\"col-sm-2 control-label\" for=\"input-pincodes\">{{ entry_pincodes }}</label>\n        <div class=\"col-sm-10\">\n          <textarea name=\"pincodes\" rows=\"5\" id=\"input-pincodes\" class=\"form-control\">{{ pincodes }}</textarea>\n        </div>\n      </div>\n      <div class=\"form-group\">\n      	<label class=\"col-sm-2 control-label\" for=\"input-pincodes-shippingprice\">{{ entry_pincodes_shipping }}</label>\n        <div class=\"col-sm-10\">\n          <input name=\"pincodes_shippingprice\" type=\"text\" id=\"input-pincodes-shippingprice\" class=\"form-control\" value=\"{{ pincodes_shippingprice }}\">\n        </div>\n      </div>\n      <div class=\"form-group\">\n        ]]>\n      </add>\n    </operation>\n  </file>\n  <file path=\"catalog/controller/extension/total/shipping.php\">\n		<operation>\n			<search><![CDATA[$results = $this->model_setting_extension->getExtensions(\'shipping\');]]>\n			</search>\n			<add position=\"after\"><![CDATA[\n				if(isset($this->session->data[\'shipping_address\'])) {\n					$this->load->model(\'extension/module/pbdp\');\n					$data[\'pincode\'] = $this->session->data[\'shipping_address\'][\'postcode\'];\n	           		$pbdp = $this->model_extension_module_pbdp->checkpin($data);\n			    	if($pbdp[\'failed\'] != \'1\') {\n						$this->model_extension_module_pbdp->savenewminorcity($this->session->data[\'shipping_address\'][\'postcode\']);\n			     		$this->session->data[\'shipping_postcode\'] =  $this->session->data[\'shipping_address\'][\'postcode\'];\n			     	}\n				}\n				if(isset($this->session->data[\'shipping_address\']) && $this->config->get(\"pbdp_pinshipping\")) {\n					$this->load->model(\'extension/module/pbdp\');\n					$shippings = $this->model_extension_module_pbdp->getShippings($this->session->data[\'shipping_address\'][\'postcode\']);\n					foreach($results as $key => $value) {\n						if(!in_array($value[\'code\'],$shippings)) {\n							unset($results[$key]);\n						}\n					}\n				}\n				]]>\n			</add>\n		</operation>\n	</file>\n	<file path=\"admin/view/template/extension/module/{pbdp_citylist,pbdp_townlist,pbdp_settings}*.twig\">\n    <operation>\n      <search><![CDATA[{{ links }}]]>\n      </search>\n      <add position=\"after\"><![CDATA[\n        <button type=\"button\" class=\"btn btn-success\" data-toggle=\"modal\" data-target=\"#helpGuide\"><i class=\"fa fa-book\" aria-hidden=\"true\"></i> Need Help</button>\n        ]]>\n      </add>\n    </operation>\n    <operation>\n      <search><![CDATA[{{ footer }}]]>\n      </search>\n      <add position=\"after\"><![CDATA[<div id=\"helpGuide\" class=\"modal fade\" role=\"dialog\">\n  <div class=\"modal-dialog\">\n    <div class=\"modal-content\">\n      <div class=\"modal-header\">\n        <button type=\"button\" class=\"close\" data-dismiss=\"modal\">&times;</button>\n        <h4 class=\"modal-title\">Support</h4>\n      </div>\n      <div class=\"modal-body\">\n          <div class=\"row\" style=\"text-align:center;\">\n        <div class=\"col-sm-12\">\n        <div class=\"col-sm-6\" style=\"margin-bottom:1em;\">\n            <a href=\"https://support.cartbinder.com/\" data-toggle=\"tooltip\" target=\"_blank\" title=\"Create / view support ticket\" class=\"btn btn-info\" style=\"width:200px;\"><i class=\"fa fa-life-ring\" aria-hidden=\"true\"></i> Create Support Ticket</a>\n        </div>\n      <div class=\"col-sm-6\" style=\"margin-bottom:1em;\">\n             <a href=\"https://www.cartbinder.com/blog/documentation/city-area-pincode-based-products-opencart/\" data-toggle=\"tooltip\" target=\"_blank\" title=\"Learn how to use the module\" class=\"btn btn-warning\" style=\"width:200px;\"><i class=\"fa fa-book\" aria-hidden=\"true\"></i> Read Documentation</a>\n             </div>\n             </div>\n             \n              <div class=\"col-sm-12\">\n      <div class=\"col-sm-6\" style=\"margin-bottom:1em;\">\n             <a href=\"https://www.cartbinder.com/store/pincode-based-products-delivery\" data-toggle=\"tooltip\" target=\"_blank\" title=\"{{ heading_title }}\" link\" class=\"btn btn-primary\" style=\"width:200px;\"><i class=\"fa fa-link\" aria-hidden=\"true\"></i> Extension Link</a>\n      </div>\n      <div class=\"col-sm-6\" style=\"margin-bottom:1em;\">\n             <a href=\"https://www.cartbinder.com/store/any-questions\" data-toggle=\"tooltip\" target=\"_blank\" title=\"Need customization\" class=\"btn btn-success\" style=\"width:200px;\"><i class=\"fa fa-edit\" aria-hidden=\"true\"></i> Need Customization</a>\n      </div>\n      </div>\n      <div class=\"col-sm-12\">\n        <br>\n        <label class=\"col-sm-12\">An extension by</label>\n        <h3><a href=\"https://www.cartbinder.com/store/\" target=\"_blank\" title=\"CartBinder : Opencart Extensions & Customizations\" style=\"color:black;\">CART<font style=\"color:#1D8F9D;font-size:27px;\">B</font>INDER</a></h3>\n      </div>\n      </div>\n      </div>\n      <div class=\"modal-footer\">\n        <button type=\"button\" class=\"btn btn-default\" data-dismiss=\"modal\">Close</button>\n      </div>\n    </div>\n\n  </div>\n</div>]]>\n      </add>\n    </operation>\n  </file>\n  <file path=\"admin/view/template/extension/module/pbdp_settings.twig\">\n    <operation>\n      <search><![CDATA[<button type=\"submit\" form=\"form\" data-toggle=\"tooltip\" title=\"{{ button_save }}\" class=\"btn btn-primary\"><i class=\"fa fa-save\"></i></button>]]>\n      </search>\n      <add position=\"replace\"><![CDATA[\n       {% if licensed_md5 is defined and licensed_md5 == \'d9a22d7a8178d5b42a8750123cbfe5b1\' %}\n      <button type=\"submit\" form=\"form\" data-toggle=\"tooltip\" title=\"{{ button_save }}\" class=\"btn btn-primary\"><i class=\"fa fa-save\"></i></button>\n        {% endif %}\n        ]]>\n      </add>\n    </operation>\n    <operation>\n      <search><![CDATA[<form action=\"{{ action }}\" method=\"post\" enctype=\"multipart/form-data\" id=\"form\" class=\"form-horizontal\">]]>\n      </search>\n      <add position=\"before\"><![CDATA[\n      {% if licensed_md5 is defined and licensed_md5 == \'d9a22d7a8178d5b42a8750123cbfe5b1\' %}\n        ]]>\n      </add>\n    </operation>\n    <operation>\n      <search><![CDATA[</form>]]>\n      </search>\n      <add position=\"after\"><![CDATA[\n         {% endif %}\n       {% if (licensed == \'none\') %} \n    {{ license_purchase_thanks }} \n    {% if (regerror is defined) %} {{ regerror_quote_msg }} {% endif %} \n    {% if (regerror is defined) %}<p style=\"color:red;\">error msg: {{ regerror }}</p>{% endif %} \n      <h2>{{ license_registration }}</h2>\n      <form name=\"reg\" method=\"post\" action=\"{{ oc_licensing_home }}register.php\" id=\"reg\" class=\"form-horizontal containr-fluid\">\n          <div class=\"form-group\">\n              <label class=\"col-sm-2 control-label\" for=\"opencart_email\">{{ license_opencart_email }}</label>\n              <div class=\"col-sm-10\">\n                <input name=\"opencart_email\" type=\"text\" autofocus required id=\"opencart_email\" form=\"reg\" class=\"form-control\"></div>\n            </div>\n    {% if (emailmal is defined and regerror == \'emailmal\') %}<p style=\"color:red;\">{{ check_email }}</p>{% endif %} \n          <div class=\"form-group\">\n              <label class=\"col-sm-2 control-label\" for=\"order_id\">{{ license_opencart_orderid }}</label>\n              <div class=\"col-sm-10\">\n                <input name=\"order_id\" type=\"text\" autofocus required id=\"order_id\" form=\"reg\" class=\"form-control\"></div>\n            </div>\n    {% if (regerror is defined and regerror == \'orderid\') %}<p style=\"color:red;\">{{ check_orderid }}</p>{% endif %} \n          <div class=\"form-group\">\n              <div class=\"col-sm-12\">\n                <button type=\"submit\" form=\"reg\" data-toggle=\"tooltip\" title=\"{{ license_registration }}\" class=\"btn btn-primary\"><i class=\"fa fa-save\"></i></button><input name=\"extension_id\" type=\"hidden\" id=\"extension_id\" form=\"reg\" value=\"{{ extension_id }}\"><input type=\"hidden\" name=\"aurl\" value=\"{{ aurl }}\" form=\"reg\"><input type=\"hidden\" name=\"auri\" value=\"{{ auri }}\"></div>\n            </div>\n    </form>\n    {% else %} \n    <div class=\"form-horizontal containr-fluid\"></div>\n    {% endif %} \n    {% if (licensed == \'curl\') %} \n    {{ server_error_curl }} \n    {% endif %}\n        ]]>\n      </add>\n    </operation>\n    <operation>\n      <search index=\"0\"><![CDATA[{% if error_warning %}]]>\n      </search>\n      <add position=\"before\"><![CDATA[\n        {% if support_status is defined and support_status == \'enabled\' %}\n        <div class=\"table-responsive\"> \n          <table id=\"order_details\" class=\"table table-bordered table-striped\">\n            <tbody>\n            <tr>\n              <td style=\"width:7%;background: #8e8e8e;color: white;\">License Info</td>\n              <td style=\"width:5%;background: #efefef;\">Order Id</td>\n              <td>{{ support_order_id }}</td>\n              <td style=\"width:4%;background: #efefef;\">Domain</td>\n              <td>{{ domain }}</td>\n              <td style=\"width:8%;background: #efefef;\">Registered To</td>\n              <td>{{ support_email }}</td>\n              <td style=\"width:7%;background: #efefef;\">Registered</td>\n              <td>{{ support_registered_date }}</td>\n              <td style=\"width:7%;background: #efefef;\">Support Ends</td>\n              <td>{{ support_order_date }}</td>\n            </tr>\n            </tbody>\n            <tfooter>\n              <tr>\n                <td colspan=\"11\" class=\"text-center\">{{ text_free_support_remaining }}</td>\n              </tr>\n            </tfooter>\n          </table>\n        </div>\n      {% else %}\n       <div class=\"table-responsive\"> \n          <table id=\"order_details\" class=\"table table-bordered table-striped\">\n            <tfooter>\n              <tr>\n                <td class=\"text-center\">{{ text_free_support_remaining }}</td>\n              </tr>\n            </tfooter>\n          </table>\n        </div>\n        {% endif %}\n        ]]>\n      </add>\n    </operation>\n  </file>\n</modification>',1,'2023-03-13 11:39:48'),
(12,15,'Bulk specials editor + the countdown timer','Bulk specials editor + the countdown timer','Dashko L. (kagan). Email: dev.dashko@gmail.com','3.2.6','http://opencart-modules.com','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n  <name>Bulk specials editor + the countdown timer</name>\n  <version>3.2.6</version>\n  <author>Dashko L. (kagan). Email: dev.dashko@gmail.com</author>\n  <code>Bulk specials editor + the countdown timer</code>\n  <link>http://opencart-modules.com</link>\n\n<!--\n  *******************************************************************************\n  *  Module: Bulk specials editor + the countdown timer\n  *  \n  *  Web-site: http://opencart-modules.com\n  *  Email: dev.dashko@gmail.com\n  *  © Leonid Dashko\n  *\n  *  Below source-code or any part of the source-code cannot be resold or distributed.\n  ******************************************************************************\n-->\n\n<!-- Output timer on the detailed product page -->\n<file path=\"catalog/model/catalog/product.php\">\n  <operation error=\"log\">\n    <search><![CDATA[getProduct($product_id) {]]></search>\n    <add position=\"after\"><![CDATA[\n    /* Bulk Specials Editor */\n    $this->load->model(\'extension/module/timer\');\n    $timer_exist = $this->model_extension_module_timer->checkExistenceExtension(\'module\', \'timer\');\n    \n    $timer_query = \'\';\n\n    if($timer_exist){\n      $timer_query .= \"\n        (SELECT date_start FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int)$this->config->get(\'config_customer_group_id\') . \"\' AND (ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS date_start, \n        (SELECT date_end FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int)$this->config->get(\'config_customer_group_id\') . \"\' AND (ps.date_end = \'0000-00-00\' OR ps.date_end > NOW()) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS date_end, \n        (SELECT timer FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int)$this->config->get(\'config_customer_group_id\') . \"\' AND (ps.date_end = \'0000-00-00\' OR ps.date_end > NOW()) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS timer, \";\n    }\n    \n    $hours_days = ($hours_days = $this->config->get(\'hours_and_days_settings\')) ? $hours_days[\'module_status\'] : false;\n    \n    if($hours_days){\n        $timer_query .= \"\n            (SELECT weekdays FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int) $this->config->get(\'config_customer_group_id\') . \"\' AND (ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS weekdays,\n            (SELECT hours FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int) $this->config->get(\'config_customer_group_id\') . \"\' AND (ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS hours, \";\n    }\n    /* Bulk Specials Editor */\n    ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[pd.name AS name, p.image,]]></search>\n    <add position=\"replace\"><![CDATA[ pd.name AS name, p.image, $timer_query ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[$query->row[\'date_modified\'],]]></search>\n    <add position=\"after\"><![CDATA[\n    /* Bulk Specials Editor */\n    \'timer\'          => ($timer_exist) ? $query->row[\'timer\'] : \'\',\n    \'date_start\'     => ($timer_exist) ? $query->row[\'date_start\'] : \'\',\n    \'date_end\'       => ($timer_exist) ? $query->row[\'date_end\'] : \'\',\n    \'datetime_end\'   => ($hours_days && !is_null($query->row[\'date_end\'])) ? $this->model_extension_module_timer->getFullDateTime($query->row[\'date_end\'], $query->row[\'weekdays\'], $query->row[\'hours\']) : \'\',\n    /* Bulk Specials Editor */\n    ]]></add>\n   </operation>\n</file>\n\n<file path=\"catalog/controller/product/product.php\">\n  <operation error=\"log\">\n    <search><![CDATA[if ((float)$product_info[\'special\']) {]]></search>\n    <add position=\"replace\"><![CDATA[\n    /* Bulk Specials Editor */\n    $this->load->model(\'extension/module/timer\');\n    $timer_exist = $this->model_extension_module_timer->checkExistenceExtension(\'module\', \'timer\');\n\n    $hours_days = ($hours_days = $this->config->get(\'hours_and_days_settings\')) ? $hours_days[\'module_status\'] : false;\n\n    $data[\'timer_custom_css_styles\'] = $this->model_extension_module_timer->getCustomCSSStyles();\n\n    $this->load->language(\'extension/module/timer\');\n    $data[\'text_timer_heading\'] = $this->language->get(\'text_timer_heading\');\n\n    $data[\'timer\'] = false; \n    $timer_settings = $this->config->get(\'timer_general_settings\');\n\n    $data[\'discount_label\'] = isset($timer_settings[\'timer_product_page_discount_label_status\']) ? 1 : 0;\n\n    if ((float)$product_info[\'special\']) {\n      if($timer_exist && isset($timer_settings[\'timer_product_page_status\'])){\n        $product_info[\'date_end\'] = ($hours_days && isset($product_info[\'datetime_end\'])) ? $product_info[\'datetime_end\'] : $product_info[\'date_end\'];\n\n        $data[\'special_date_diff\'] = $this->model_extension_module_timer->getSpecialDateDiff($product_info[\'date_end\']);\n        $data[\'percentage_discount\'] = $this->model_extension_module_timer->calculateTotalDiscount($product_info[\'price\'], $product_info[\'special\']);\n        $data[\'timer\'] = $product_info[\'timer\'];\n\n        // Load .js files and .css if we need it \n        $this->document->addStyle(\'catalog/view/javascript/timer/css/timer.css\');\n        $this->document->addScript(\'catal