mer->getSpecialGroups();\n\n    $timer_exist = $this->model_extension_module_timer->checkExistenceExtension(\'module\', \'timer\');\n\n    if($timer_exist){\n      $data[\'timer\'] = true;\n    } else {\n      $data[\'timer\'] = false;\n    }\n    /* Bulk Specials Editor */\n    ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[$this->language->get(\'entry_customer_group\');]]></search>\n    <add position=\"after\"><![CDATA[\n    /* Bulk Specials Editor */\n    $data[\'entry_special_group\'] = $this->language->get(\'entry_special_group\');\n    $data[\'entry_timer\'] = $this->language->get(\'entry_timer\');\n    /* Bulk Specials Editor */\n    ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[$product_special[\'price\'],]]></search>\n    <add position=\"after\"><![CDATA[\n    /* Bulk Specials Editor */\n    \'timer\'                    => ($timer_exist) ? $product_special[\'timer\'] : \'\',\n    \'product_special_group_id\' => ($timer_exist) ? $product_special[\'product_special_group_id\'] : 0,\n    /* Bulk Specials Editor */\n    ]]></add>\n   </operation>\n</file>\n\n<file path=\"admin/view/template/catalog/product_form.twig\">\n  <operation error=\"log\">\n    <search><![CDATA[<td colspan=\"5\">]]></search>\n    <add position=\"replace\"><![CDATA[\n    {# Bulk Specials Editor #}\n    {% if timer %}\n      <td colspan=\"7\">\n    {% else %}\n      <td colspan=\"5\">\n    {% endif %}\n    {# Bulk Specials Editor #}\n    ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[<td class=\"text-right\"><input type=\"text\" name=\"product_special[{{ special_row }}][priority]]]></search>\n    <add position=\"before\"><![CDATA[\n    {# Bulk Specials Editor #}\n    {% if timer %}\n      <td class=\"text-left\">\n        <select name=\"product_special[{{ special_row }}][product_special_group_id]\" class=\"form-control\">\n          <option value=\"0\"></option>\n          {% for special_group in special_groups %}\n          {% if special_group.product_special_group_id == product_special.product_special_group_id %}\n          <option value=\"{{ special_group.product_special_group_id }}\" selected=\"selected\">{{ special_group.name }}</option>\n          {% else %}\n          <option value=\"{{ special_group.product_special_group_id }}\">{{ special_group.name }}</option>\n          {% endif %}\n          {% endfor %}\n        </select>\n      </td>\n    {% endif %}\n    {# Bulk Specials Editor #}\n    ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[<td class=\"text-left\"><button type=\"button\" onclick=\"$(\'#special-row]]></search>\n    <add position=\"before\"><![CDATA[\n    {# Bulk Specials Editor #}\n    {% if timer %}\n      <td class=\"center\">\n        <select name=\"product_special[{{ special_row }}][timer]\" class=\"form-control\">\n          <option value=1 {{ product_special.timer == 1 ? \'selected\' : \'\' }} >{{ text_enabled }}</option>\n          <option value=0 {{ product_special.timer == 0 ? \'selected\' : \'\' }} >{{ text_disabled }}</option>\n        </select>\n      </td>\n    {% endif %}\n    {# Bulk Specials Editor #}\n    ]]></add>\n  </operation>\n  <operation error=\"log\">\n    <search><![CDATA[html += \'  <td class=\"text-right\"><input type=\"text\" name=\"product_special[\' + special_row + \'][priority]]]></search>\n    <add position=\"before\"><![CDATA[\n    /* Bulk Specials Editor */\n    {% if timer %}\n      html += \'  <td class=\"text-left\"><select name=\"product_special[\' + special_row + \'][product_special_group_id]\" class=\"form-control\">\';\n      html += \'    <option value=\"0\"></option>\';\n      {% for special_group in special_groups %}\n      html += \'    <option value=\"{{ special_group.product_special_group_id }}\">{{ special_group.name | escape(\'js\') }}</option>\';\n      {% endfor %}\n      html += \'  </select></td>\';\n    {% endif %}\n    /* Bulk Specials Editor */\n    ]]><