INSERT INTO `oc_product_description` VALUES
(217,1,'Ryan Study Desk- Rosewood Finish','','','Ryan Study Desk- Rosewood Finish','',''),
(131,1,'Paperica Chair','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;line-height: 115%; font-size: 14pt; font-family: Calibri, sans-serif;&quot;&gt;Paperica\r\nChair is originated to keep a perfect balance of functionality &amp;amp; aesthetics,\r\nwhen not in use you can fold it to use that space for something else. Then\r\nchair is made up of mango wood which is dried in kiln, mango wood is\r\ncategorized as a hardwood, due to its dense grains. This means it is a strong\r\n&amp;amp; durable wood making it perfect for furniture. Due to the density of wood,\r\nit doesn’t wear out easily &amp;amp; can keep its high lustre texture for many\r\nyears.&lt;br&gt;\r\n&lt;br&gt;\r\nUtility – This chair has enough space for one person to sit &amp;amp; also it can\r\nbe folded.&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;','','Jim Wall Shelf (American Chestnut)','','');
